export default (state = null, action) => {
    switch(action.type) {
        case 'ON_LOCATION':
            return 
    }
    if(action.type === 'ON_MAIN')
        return 'main';
    if(action.type === 'ON_ABOUT')
        return 'about';
    if(action.type === 'OFF_PAGE')
        return null;
    else return state;
}
